# Now, lets automate this context injection so that model search intended summary for particular company from dataframe and inject as prompt to find the details of the company.We will use text embedding for this

"""# Text Embedding for context injection into LLMs"""

from vertexai.language_models import TextEmbeddingModel
embederModel = TextEmbeddingModel.from_pretrained('textembedding-gecko@001')

embeddings = embederModel.get_embeddings(['My name is Sam'])
print(embeddings)

embeddings[0].values

len(embeddings[0].values)

#create small df
df = df.head(10)

def getSummaryEmbedding(summary):
  return embederModel.get_embeddings([summary])[0].values

#example
getSummaryEmbedding(df['summary'][0])

#applying embedding on all summary
df['Embedding'] = df['summary'].apply(getSummaryEmbedding)

df.head()

df.to_csv('1.csv')

