import numpy as np

def vecSimilarity(A,B):
  vec1 = np.array(A)
  vec2 = np.array(B)
  return np.dot(np.array(A),np.array(A))

vecSimilarity(df.iloc[0]['Embedding'],df.iloc[1]['Embedding'])

