# Write a function to embed the question asked and inject this as prompt to LLM.
def embed_prompt_lookup():
    # Initial question
    question = input("What question do you have about a start up company? ")

    # Get embedding for every question user ask
    prompt_embedding = getSummaryEmbedding(question)

    # Get prompt similarity with embeddings
    # Note how this will overwrite the prompt similarity column each time!
    df["prompt_similarity"] =df['Embedding'].apply(lambda x: vecSimilarity(x, prompt_embedding))

    # get most similar summary
    context = df.nlargest(1,'prompt_similarity').iloc[0]['summary']
    # Prompt + context injection
    prompt = f"""Only answer the question below if you have 100% certainty of the facts, use the context below to answer.
            Here is some context:
            {context}
            Q: {question}
            A:"""


    # Hallucinates Some Information
    results = llm.predict(prompt=prompt,temperature=0,max_output_tokens=2048)

    print(results.text)

embed_prompt_lookup()



